    locations = {'New York': 'East Coast', 'Los Angeles': 'West Coast', 'Chicago': 'Midwest', 'Houston': 'South', 'San Francisco': 'West Coast', 'Seattle': 'West Coast', 'Boston': 'East Coast', 'Atlanta': 'South', 'Dallas': 'South'}
    output_data = []
    for person in input_data:
        age = person['']
        age_group = next((group for ((lower, upper), group) in age_groups.items() if lower <= age <= upper), 'senior')
        city = person['city']
        location = locations.get(city, 'Other')
        output_person = {'name': person['name'], 'age_group': age_group, 'gender': person['gender'], 'location': location, 'hobbies': person['hobbies']}
        output_data.append(output_person)
    return output_data

